Scat (Shiloh Fernandez) heeft het idee om een nieuwe frisdrank op de markt te brengen onder de naam Fukk Cola. Hij legt het voor aan 6 (Amber Heard), de productie-manager van Coke, die denkt dat het een groot potentieel heeft om hem rijk te maken. Maar Scats kamergenoot Sneaky Pete (Kellan Lutz) ziet kansen voor zichzelf en steelt het idee om er zelf mee naar de hoge bazen te gaan.



